import React, {Component} from "react";

class Card extends Component
{
    constructor(props) {
        super(props);
        itemTovar = this.props.tovar
    }
    render() {
        return (
            <div className="card">
                <div className="selected">
                    <img src="/img/like.svg" alt='liked'/>
                </div>
                <img width={133} height={112} src={this.props.img} alt='sneacker'/>
                <h5>{this.props.name}</h5>
                <div className='d-flex justify-between align-center'>
                    <div className='d-flex flex-column'>
                        <span>Цена:</span>
                        <b>{this.props.price} руб.</b>
                    </div>
                    <button className='btn'>
                        <img width={11} height={11} src="/img/btn.png"/>
                    </button>
                </div>
            </div>
        );
    }
}


export default Card;
